const map = input.split("\n");
const width = map[0].length;
const height = map.length - 1;

const getTreeHits = (right, down) => {
  let count = 0;
  for (let i = 1; i*down <= height; i++) {
    const y = i*down;
    const x = (right*i) % width;
    count = count + (map[y][x] === '#' ? 1 : 0);
  }
  return count;
}
const treeHits = [[1, 1], [3, 1], [5, 1], [7, 1], [1, 2]].map(p => getTreeHits(...p));
console.log(treeHits.reduce((t, n) => t * n, 1));